import React from "react";
import Canvas from "./components/Canvas";

function App() {
  const handleButton = () => {
    const inputData = {
      kecepatan: (document.getElementById("kecepatan") as HTMLInputElement).value,
      sudut: (document.getElementById("sudut") as HTMLInputElement).value,
      warna: (document.getElementById("warna") as HTMLInputElement).value,
    };

    console.log(inputData);
  };

  return (
    <div className="font-sans">
      <input type="number" id="kecepatan" placeholder="Masukan kecepatan..." />
      <input type="number" id="sudut" placeholder="Masukan untuk sudut.." />
      <input type="color" name="warna" id="warna" />
      <button onClick={handleButton} className="bg-sky">GO!</button>
      <Canvas />
    </div>
  );
}

export default App;
